import React, { Component } from 'react';

class Counter extends Component {

    render() { 

        return ( 
            <React.Fragment>
                <span>{this.state.count}</span> 
                <button 
                    onClick={()=>this.state.count+1}
                >
                Increment</button>
            </React.Fragment>
        );
    }
}

export default Counter;
